import Vue from 'vue'
import App from './App.vue'
import router from './router'
import store from './store'
import "./assets/css/commo.css"
import Vant from 'vant';
import 'vant/lib/index.css';


//公共css文件 

Vue.config.productionTip = false
Vue.use(Vant);

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app')
